6 Benefits Of Walking!üí™Want to know one of the best forms of exercise that can be done in any capacity?‚Å£
‚Å£
It's walking!‚Å£
‚Å£
I always post my step count on my story because I want to motivate you to get out there and get to steppin'!‚Å£
‚Å£
Walking is great because it can be done almost anywhere, helps burn calories, and can help you feel great.‚Å£
‚Å£
Walking can strengthen your physical and mental health!‚Å£
‚Å£
Do you feel stressed? Going on a walk while listening to some upbeat music can help you out!‚Å£
‚Å£
Or maybe you are super busy throughout the week and don't have time to read a book/article. You can listen to it on your device while walking!‚Å£
‚Å£
My personal goal is to walk 8-12k steps a day.‚Å£
‚Å£
This is a personal goal that I set out to help me stay accountable and stay active.‚Å£
‚Å£
You can walk however many steps you want to! I just want you to stay active and get those steps in.‚Å£
‚Å£
Even if it's going for a walk around the block a few times... that's much better than not getting any steps in at all!‚Å£
‚Å£
What do you enjoy doing while going for walks? I love listening to podcasts and music. It makes the time fly by!‚Å£
‚Å£
